import React from "react";
import {FaSearch} from "react-icons/fa";

export const SearchBar = () => {
    return (
        <div className = 'searchBar'>
          <FaSearch id = "search-icon"></FaSearch>
          <input
            type="text"
            placeholder="Search videos..."
          />
        </div>
    )
}
